function TownMapUpdateHandler(TownId, X, Y, Friendly) {

    if (reqMap.readyState == 4 /*complete*/) {
        var isSelectable = true;
        var resData = eval(reqMap.responseText);
        if (resData.length > 0) {
            for (i = 0; i < resData.length; i++) {
                GeoID[i] = resData[i].geoID;
                var inputsMap = document.getElementsByName('map' + i % 3 + Math.floor(i / 3));
                var inputsCity = document.getElementsByName('city' + i % 3 + Math.floor(i / 3));
                var inputsDir = document.getElementsByName('attHigh' + i % 3 + Math.floor(i / 3));
                var inputsArmy = document.getElementsByName('army' + i % 3 + Math.floor(i / 3));
                var inputsHarvesting = document.getElementsByName('carav' + i % 3 + Math.floor(i / 3));
                var inputsRes = document.getElementsByName('res' + i % 3 + Math.floor(i / 3));
                for (ii = 0; ii < inputsMap.length; ii++) {
                    if (isInteger(resData[i].townId) && resData[i].townId > 0) {
                        var icon;
                        if (resData[i].population < 50)
                            icon = "city1_1";
                        else if (resData[i].population >= 50 && resData[i].population < 210)
                            icon = "city1_2";
                        else if (resData[i].population >= 210 && resData[i].population < 400)
                            icon = "city1_3";
                        else if (resData[i].population >= 400 && resData[i].population < 1600)
                            icon = "city1_4";
                        else if (resData[i].population >= 1600 && resData[i].population < 6000)
                            icon = "city1_5";
                        else if (resData[i].population >= 6000)
                            icon = "city1_6";
                        else
                            icon = "1";
                        inputsCity[ii].src = "/img/map_tiles/" + icon + ".png";

                        if (!inputsArmy[ii].src.endsWith('map_tiles/1.png')) inputsArmy[ii].src = '/img/map_tiles/1.png';
                        if (!inputsHarvesting[ii].src.endsWith('map_tiles/1.png')) inputsHarvesting[ii].src = '/img/map_tiles/1.png';
                        if (!inputsRes[ii].src.endsWith('map_tiles/1.png')) inputsRes[ii].src = '/img/map_tiles/1.png';
                    }
                    else {
                        if (!inputsCity[ii].src.endsWith('map_tiles/1.png')) inputsCity[ii].src = '/img/map_tiles/1.png'; 
                        var icon = "/img/flags/";
                        if (resData[i].PlayerArmiesCount > 0) {
                            switch (resData[i].PlayerMainArmyRelationshipTypeID) {
                                case 1: // War
                                    icon += "flag_red_troops_red_flag";
                                    break;
                                case 2: // Truce
                                    icon += "flag_grey_troops_blue_flag";
                                    break;
                                case 3: // Peace
                                    icon += "flag_grey_troops_green_flag";
                                    break;
                                case 4: // NAP
                                    icon += "flag_grey_troops_yellow_flag";
                                    break;
                                case 5: // Powerbloc
                                    icon += "flag_green_troops_green_flag";
                                    break;
                                case 6: // Wing
                                    icon += "flag_green_troops_blue_flag";
                                    break;
                                case 7: // War Pending
                                    icon += "flag_red_troops_yellow_flag";
                                    break;
                                case 8: // Neutral
                                    icon += "flag_grey_troops_red_flag";
                                    break;
                                default: // Neutral
                                    icon += "flag_grey_troops_red_flag";
                                    break;
                            }
                            icon += ".png";
                            inputsArmy[ii].src = icon;
                        }
                        else { if (!inputsArmy[ii].src.endsWith('map_tiles/1.png')) inputsArmy[ii].src = '/img/map_tiles/1.png'; }

                        var icon = "/img/flags/";
                        if (resData[i].NPCHarvestingPlayerID > 0) {
                            switch (resData[i].NPCHarvestingPlayerRelationshipID) {
                                case 1: // War
                                    icon += "flag_red_caravan_red_flag";
                                    break;
                                case 2: // Truce
                                    icon += "flag_grey_caravan_blue_flag";
                                    break;
                                case 3: // Peace
                                    icon += "flag_grey_caravan_green_flag";
                                    break;
                                case 4: // NAP
                                    icon += "flag_grey_caravan_yellow_flag";
                                    break;
                                case 5: // Powerbloc
                                    icon += "flag_green_caravan_green_flag";
                                    break;
                                case 6: // Wing
                                    icon += "flag_green_caravan_blue_flag";
                                    break;
                                case 7: // War Pending
                                    icon += "flag_red_caravan_yellow_flag";
                                    break;
                                case 8: // Neutral
                                    icon += "flag_grey_caravan_red_flag";
                                    break;
                                default: // Neutral
                                    icon += "flag_grey_caravan_red_flag";
                                    break;
                            }
                            icon += ".png";
                            inputsHarvesting[ii].src = icon;
                        }
                        else { if (!inputsHarvesting[ii].src.endsWith('map_tiles/1.png')) inputsHarvesting[ii].src = '/img/map_tiles/1.png'; }

                        var icon = "/img/map_tiles/res";
                        if (resData[i].NPCOverallTypeID > 0) {
                            icon += resData[i].NPCTypeID;
                            if (resData[i].NPCOverallTypeID == 1) {
                                icon += ".gif";
                            }
                            else {
                                icon += ".png";
                            }
                            inputsRes[ii].src = icon;
                        }
                        else { if (!inputsRes[ii].src.endsWith('map_tiles/1.png')) inputsRes[ii].src = '/img/map_tiles/1.png'; }

                        if ((resData[i].x > 1000 || resData[i].x < -1000 || resData[i].y < -1000 || resData[i].y > 1000 ) && i == 4) { inputsCity[ii].src = "/img/map_tiles/noAttack.png"; isSelectable = false; } else { inputsCity[ii].src = "/img/map_tiles/1.png"; } 
                    }
                    if (resData[i].isSelectable == 0) { inputsDir[ii].src = "/img/map_tiles/noAttack.png" }
                    else {
                        switch (i) {
                            case 0:
                                inputsDir[ii].src = "/img/map_tiles/cAttack_SE.png"
                                break;
                            case 1:
                                inputsDir[ii].src = "/img/map_tiles/cAttack_S.png"
                                break;
                            case 2:
                                inputsDir[ii].src = "/img/map_tiles/cAttack_SW.png"
                                break;

                            case 3:
                                inputsDir[ii].src = "/img/map_tiles/cAttack_E.png"
                                break;
                            case 4:
                                inputsDir[ii].src = "/img/map_tiles/noAttack.png"
                                break;
                            case 5:
                                inputsDir[ii].src = "/img/map_tiles/cAttack_W.png"
                                break;

                            case 6:
                                inputsDir[ii].src = "/img/map_tiles/cAttack_NE.png"
                                break;
                            case 7:
                                inputsDir[ii].src = "/img/map_tiles/cAttack_N.png"
                                break;
                            case 8:
                                inputsDir[ii].src = "/img/map_tiles/cAttack_NW.png"
                                break;
                        }
                    }
                inputsMap[ii].src = "/img/map_tiles/" + resData[i].terrainTypeId + ".png";
                }
            }
        }
        if (UpdateActions) UpdateActions(TownId, Friendly, isSelectable);
    }
}

