var woodResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;width:80px;height:80px" src="/img/resource_icons/resource_icon_wood.png" /><span style="font-size:7pt;font-style:italic"><b>Wood</b><br />Wood is produced by Lumberjacks in the forests near your town, and is used in most building\'s construction as well as for many other production purposes such as making bows and spears.</span><br style="clear:both" /><br />',foodResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;width:80px;height:80px" src="/img/resource_icons/resource_icon_food.png" /><span style="font-size:7pt;font-style:italic"><b>Food</b><br />Food is produced by workers in the Farmyards near your town, and is used to feed your town\'s civilian workers.  The more food you have, the larger your town can grow.</span><br style="clear:both" /><br />',
horsesResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;width:80px;height:80px" src="/img/resource_icons/resource_icon_horses.png" /><span style="font-size:7pt;font-style:italic"><b>Horses</b><br />Horses are required for a number of different units that require either speed or heft - ranging from all military Cavalry types, most of the advanced Diplomatic units, and large-scale wagon trains such as Settlers.</span><br style="clear:both" /><br />',spearsResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_spear.png" /><span style="font-size:7pt;font-style:italic"><b>Spears</b><br /> Not simply a pointy stick, making a proper spear is an expert job.  The spearmaker takes carefully hardened wood and turns it until it is as strong as possible, before binding metal bands and a metal tip to the spear.</span><br style="clear:both" /><br />',
leatherResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_leather.png" /><span style="font-size:7pt;font-style:italic"><b>Leather Armour</b><br /> The Tanner takes the hide from Livestock, cures, wrangles and dries it before layering it around mannikins to form a durable protective sheath of leather.</span><br style="clear:both" /><br />',clayResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;width:80px;height:80px" src="/img/resource_icons/resource_icon_clay.png" /><span style="font-size:7pt;font-style:italic"><b>Clay</b><br />Clay is produced by workers in the Clay Pits near your town, and is used in building construction as bricks, as well as for making molds for various types of metalworking production.</span><br style="clear:both" /><br />',
goldResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_gold.png" /><span style="font-size:7pt;font-style:italic"><b>Gold</b><br />Gold is generated from taxing your civilian workers, and is used to pay your diplomatic and military units.  You can choose your town\'s tax rate in the Castle, but higher taxes mean less production.</span><br style="clear:both" /><br />',livestockResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_livestock.png" /><span style="font-size:7pt;font-style:italic"><b>Livestock</b><br />Livestock are used for a variety of purposes; most usually for the Tanner to produce Leather Armour and for the Saddlemaker to produce Saddles, but also for some of the darker spells, as sacrifices.</span><br style="clear:both" /><br />',
swordsResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_sword.png" /><span style="font-size:7pt;font-style:italic"><b>Swords</b><br /> Skilled blacksmiths work diligently to produce the best weapons for your Troops to use</span><br style="clear:both" /><br />',chainResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_chainmail.png" /><span style="font-size:7pt;font-style:italic"><b>Chain Mail Armour</b><br /> Skilled blacksmiths work diligently to produce the best armour for your Troops to wear.</span><br /><br />',
ironResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;width:80px;height:80px" src="/img/resource_icons/resource_icon_iron.png" /><span style="font-size:7pt;font-style:italic"><b>Iron</b><br />Iron is produced by workers in the Iron Mines near your town, and is used in building construction, but mostly for military production such as swords and armour.</span><br style="clear:both" /><br />',manaResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_mana.png" /><span style="font-size:7pt;font-style:italic"><b>Mana</b><br />All spells cost Mana to cast, and many of them also cost Mana to upkeep.  Most spells also cost other resources to cast - especially books.  You cast spells - if you have researched them - on the Spells screen in this building.</span><br style="clear:both" /><br />',
beerResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_beer.png" /><span style="font-size:7pt;font-style:italic"><b>Beer</b><br /> Beer is used in the Tavern for loosening the tongues of those who might have some tasks (Quests) for you. It is also used in the recruitment of some of the thirstier military units.</span><br style="clear:both" /><br />',bowsResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_bow.png" /><span style="font-size:7pt;font-style:italic"><b>Bows</b><br /> Master craftsmen of wood gently shape great arcs of yew into perfectly balanced bows, whilst their apprentices practice the art of fletching arrows so they fly as straight and true as humanly possible.</span><br style="clear:both" /><br />',
plateResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_plate.png" /><span style="font-size:7pt;font-style:italic"><b>Plate Armour</b><br />In the hottest fires of the Forge, the finest and strongest Plate Steel is melded to produce incredibly durable suits of armour for your Troops.</span><br style="clear:both" /><br />',stoneResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;width:80px;height:80px" src="/img/resource_icons/resource_icon_stone.png" /><span style="font-size:7pt;font-style:italic"><b>Stone</b><br />Stone is produced by workers in the Quarries near your town, and is used for building construction - especially the City Wall - and for some spellcasting and Siege Engine production projects.</span><br style="clear:both" /><br />',
researchResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_research.png" /><span style="font-size:7pt;font-style:italic"><b>Research</b><br />Research Points can be turned into Technologies either on the Library "Research" page, or via the "Research Summary" at the top of your screen.</span><br style="clear:both" /><br />',booksResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_book.png" /><span style="font-size:7pt;font-style:italic"><b>Books</b><br />Books are incredibly laborious to produce, but critical for almost every spellcasting activity and for any kind of knowledge transfer to another city, where they can be read and transferred into Research Points.</span><br style="clear:both" /><br />',
saddlesResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_saddles.png" /><span style="font-size:7pt;font-style:italic"><b>Saddles</b><br /> The Saddlemaker takes the finest quality leather from Livestock hides, and expertly crafts it into supple but strong items of cavalry tack such as saddles, reins and blinkers.</span><br style="clear:both" /><br />',siegeResDesc='<img style="float:left;margin-right:2px;margin-bottom:2px;" src="/img/resource_icons/resource_icon_siege.png" /><span style="font-size:7pt;font-style:italic"><b>Siege Blocks</b><br /> Siege Blocks are vital for making Illyriad\'s largest weapons of war - from catapults and ballistas to battering rams and siege towers.</span><br style="clear:both" /><br />';
